import React from 'react';
import './AboutNext.css'


function AboutNext() {

    return (
    <section className="aboutNext slide" id="aboutNext"> 
      <p>Jesteśmy grupą ludzi która</p>
      <p>buduje domy</p>
      <p>z pasją i poświeceniem</p>
      <p>zbudujemy rowniez Twoj</p>
      <p>wymarzony dom</p>
    </section>
  );
}

export default AboutNext;
